import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const styles = {
    main: {
      backgroundColor: '#253041',
      color: '#C9D1D9',
      minHeight: '100vh',
      fontFamily: "'Roboto', sans-serif",
    },
    heroSection: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '2rem',
      flexDirection: isMobileView ? 'column' : 'row',
      marginTop: '4rem',
      padding: '0 2rem',
    },
    image: {
      width: isMobileView ? '50%' : '15%',
      borderRadius: '5%',
    },
    paragraph: {
      fontSize: isMobileView ? '18px' : '20px',
      textAlign: 'left',
      lineHeight: '1.6',
      maxWidth: isMobileView ? '95%' : '50%',
    },
    sectionHeader: {
      textAlign: 'center',
      margin: '4rem 0 2rem',
      color: '#aaa',
      fontWeight: 'normal',
      fontSize: isMobileView ? '1.2rem' : '1.5rem',
    },
    logoContainer: {
      display: 'flex',
      justifyContent: 'space-evenly',
      gap: '2rem',
      margin: '2rem 0',
    },
    logo: {
      width: isMobileView ? '30px' : '50px',
      filter: 'grayscale(100%)',
      transition: 'filter 0.3s ease-in-out',
    },
    tooltip: {
      position: 'absolute',
      backgroundColor: '#555',
      color: '#fff',
      padding: '5px 10px',
      borderRadius: '6px',
      fontSize: '12px',
      bottom: '130%',
      left: '50%',
      transform: 'translateX(-50%)',
      whiteSpace: 'nowrap',
      zIndex: '1',
      visibility: 'hidden',
      opacity: 0,
      transition: 'opacity 0.2s ease-in-out',
    },
    tooltipVisible: {
      visibility: 'visible',
      opacity: 1,
    },
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
        id: '2024-present',
        icon: renuem,
        title: 'Lead Full Stack Developer - Renuem',
        description: `Renuem is a platform aimed at democratizing access to renewable energy investments. By leveraging blockchain and 
        other innovative technologies, Renuem enables retail investors to fund renewable energy projects globally, while also 
        providing a marketplace for developers to release equity in their existing energy assets. The platform empowers individuals 
        to invest in clean energy, earn sustainable returns, and contribute to reducing carbon emissions.

        In my role as Lead Full Stack Developer at Renuem, I am responsible for overseeing the development of both the mobile and 
        web applications. I lead a team of developers in building scalable, secure, and user-friendly systems. Using technologies 
        such as React Native for mobile apps, Node.js for the backend, and integrating blockchain for transaction transparency, 
        I ensure the platform delivers an optimal experience. I also play a crucial role in integrating advanced data analytics 
        features, providing real-time performance metrics to investors and stakeholders, and ensuring that all development meets 
        the highest standards of security and regulatory compliance.`,
    },
    {
        id: '2023-2024',
        icon: clearear,
        title: 'Senior Full Stack Developer - Clear Ear',
        description: `Clear Ear is a healthcare technology company that focuses on developing digital solutions to help healthcare providers 
        better manage their appointments and improve patient care. Their flagship product is an appointment management platform 
        that simplifies scheduling, reduces no-shows, and integrates seamlessly with clinic management systems.

        As a Senior Full Stack Developer at Clear Ear, I led the end-to-end development of the appointment management system. 
        My role included designing the architecture for the backend using Node.js, integrating with third-party APIs for patient 
        records, and building a dynamic frontend with React. I worked closely with the product and operations teams to automate 
        scheduling workflows and enhance patient data security. Additionally, I contributed to the implementation of real-time 
        notifications and analytics features, which provided healthcare providers with key insights to improve operational efficiency 
        and enhance the patient experience.`,
    },
    {
        id: '2022-2023',
        icon: mohammedGithub,
        title: 'Freelance Full Stack Developer & Data Analyst',
        description: `As a freelance Full Stack Developer and Data Analyst, I provided custom software development and data solutions 
        for various small businesses and startups across different industries. My services included building scalable web applications, 
        data visualization dashboards, and implementing data pipelines to analyze business metrics.

        I developed end-to-end web applications with technologies like React and Node.js, focusing on user-centric design and 
        performance optimization. Additionally, I leveraged Python, SQL, and machine learning algorithms to help businesses make 
        data-driven decisions. I also created interactive dashboards for clients to visualize their data in real time, which enabled 
        them to track key performance indicators and improve operational efficiency. My goal was always to deliver solutions that 
        were both technically robust and aligned with the client’s strategic goals.`,
    },
    {
        id: '2022-2023',
        icon: mohammedGithub,
        title: 'Software Engineer - Freelance Projects',
        description: `As a freelance Software Engineer, I worked on a variety of software development projects, focusing on improving 
        the performance, security, and scalability of existing applications. My responsibilities included code refactoring, 
        performance tuning, and resolving technical debt in complex systems.

        I specialized in optimizing backend services built with Node.js, ensuring they could handle increased traffic while 
        maintaining fast response times. I also contributed to front-end development, primarily using React, to create clean, 
        responsive interfaces. Throughout these projects, I emphasized the use of best practices in coding, version control, 
        and deployment, ensuring that applications were scalable, maintainable, and secure. My efforts were instrumental in 
        improving the overall performance and user experience of the applications.`,
    },
    {
        id: '2021-2023',
        icon: theresidentsclub,
        title: 'Lead IT Manager - The Residents Club',
        description: `The Residents Club is a luxury residential community that integrates advanced technology to provide a modern living 
        experience. The club offers smart home features, high-end security systems, and amenities tailored to the needs of its residents.

        As Lead IT Manager, I oversaw all aspects of the IT infrastructure for the club, including managing smart home integrations, 
        network security, and resident-facing applications. I led a team responsible for maintaining the technology stack, ensuring 
        that all systems were running smoothly and securely. In addition, I used data analytics tools to track energy consumption, 
        waste management, and resident satisfaction, providing actionable insights that improved the club’s sustainability efforts and 
        service delivery. My role required a combination of technical expertise, leadership, and strategic planning to enhance both 
        the technology and the overall resident experience.`,
    },
    {
        id: '2020-2023',
        icon: MosGames,
        title: 'Founder & General Manager - Mo\'s Games',
        description: `Mo's Games is a popular gaming lounge located in Lahore, providing gamers with high-end equipment, a wide variety 
        of games, and a space to socialize and compete. The business became a community hub for gamers in the area and offered 
        competitive tournaments, casual gaming, and a café space.

        As the Founder and General Manager, I was responsible for every aspect of the business, from day-to-day operations to strategic 
        planning. I developed a custom point-of-sale (POS) system to streamline bookings, payment processing, and inventory management. 
        I also led marketing efforts, including organizing gaming tournaments and social media campaigns, which contributed to the 
        lounge’s success. My technical skills were instrumental in setting up and maintaining the gaming infrastructure, ensuring 
        the best experience for our customers. Additionally, I learned to balance business needs, customer satisfaction, and 
        operational efficiency, which helped sustain growth and profitability.`,
    },
];


  return (
    <div style={styles.main}>
      <div style={styles.heroSection}>
        <img src={untitled} alt="Mohammed" style={styles.image} />
        <div style={styles.paragraph}>
          <p>
            With over 7 years of experience as a Full Stack Developer and Data Analyst, I’ve built my career
            around designing efficient, user-focused solutions that bridge technical innovation with real-world impact.
            My expertise spans front-end and back-end development, leveraging tools like React Native, Node.js, and
            database management to create scalable applications for startups and enterprises.
          </p>
          <p>
            I’ve also been fortunate to combine my technical skills with entrepreneurial insight. For instance, I played
            a key role in launching innovative ventures, such as introducing fruit bubble tea to the Pakistani market while
            managing a dynamic gaming lounge in Lahore. This experience sharpened my ability to analyze market trends, lead
            teams, and deliver customer-centric solutions.
          </p>
          <p>
            Outside of work, I’m always exploring the latest in technology, tackling coding challenges, and pursuing hobbies
            like gaming, photography, and solving puzzles. I believe in continually refining my skills while staying grounded
            in creativity and innovation.
          </p>
          <p>
            If you’re interested in learning more about my projects or discussing collaboration opportunities, feel free to
            explore further.
          </p>
        </div>
      </div>

      <h3 style={styles.sectionHeader}>Tech Languages</h3>
      <div style={styles.logoContainer}>
        {techLanguages.map(({ id, src, name }) => (
          <div
            key={id}
            style={{ position: 'relative' }}
            onMouseEnter={() => handleLogoHover(id)}
            onMouseLeave={() => handleLogoLeave(id)}
          >
            <img
              id={id}
              src={src}
              alt={name}
              style={styles.logo}
              onMouseEnter={(e) => (e.currentTarget.style.filter = 'grayscale(0%)')}
              onMouseLeave={(e) => (e.currentTarget.style.filter = 'grayscale(100%)')}
            />
            <div
              style={{
                ...styles.tooltip,
                ...(tooltipVisible[id] ? styles.tooltipVisible : {}),
              }}
            >
              {name}
            </div>
          </div>
        ))}
      </div>

      <h3 style={styles.sectionHeader}>Work History</h3>
      <Timeline position={isMobileView ? 'right' : 'alternate'}>
        {workHistory.map(({ id, icon, title, description }) => (
          <TimelineItem key={id}>
            <TimelineOppositeContent
              sx={{ m: 'auto 0' }}
              align="right"
              variant="body2"
              color="#808080"
            >
              {id}
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineConnector />
              <img src={icon} alt={title} style={{ width: '30px', borderRadius: '50%' }} />
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent sx={{ py: '12px', px: 2 }}>
              <Typography variant="h6" component="span">{title}</Typography>
              <Typography>{description}</Typography>
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
